import "./App.css";
import Data from "./components/Data";

function App() {
  return (
    <>
      <table class="table table-dark">
        <thead>
          <tr>
            <th scope="col">Title</th>
            <th scope="col">Genre</th>
            <th scope="col">Stock</th>
            <th scope="col">Rate</th>
          </tr>
        </thead>

        <tbody>
          {Data.map((index) => {
            return (
                <tr>
                  <td>{index.title}</td>
                  <td>{index.genre}</td>
                  <td>{index.stock}</td>
                  <td>{index.rate}</td>
                  <td>{<button></button>}</td>
                </tr>
            );
          })}
          ;
        </tbody>
      </table>
    </>
  );
}

export default App;
